	"sap/ushell/plugins/rta/i18n/i18n_ca.properties":'# Resource bundle for runtime authoring ushell plug-in\n# \n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nRTA_BUTTON_TEXT=Ajustar IU\n#XTIT\nERROR_TITLE=El mode d\'ajust d\'IU no es pot iniciar\n\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=Connector FLP RTA\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Esteu utilitzant un navegador que no s\'admet. Utilitzeu Google Chrome o Microsoft Internet Explorer (versi\\u00F3 10 o posterior).\n#XMSG: Technical error\nTECHNICAL_ERROR=Error t\\u00E8cnic. Poseu-vos en contacte amb l\'equip de suport t\\u00E8cnic.\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=No s\'admet el navegador\n\n#XHED: Title of a dialog explaining that adaptation will be closed\nHEADER_FLEX_DISABLED=Informaci\\u00F3\n\n#XMSG: Dialog message for flex not enabled\nMSG_FLEX_DISABLED=Aquesta aplicaci\\u00F3 no est\\u00E0 activada per l\'ajust. Per obtenir m\\u00E9s informaci\\u00F3, consulteu [aqu\\u00ED] (https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
	"sap/ushell/plugins/rta/i18n/i18n_cs.properties":'# Resource bundle for runtime authoring ushell plug-in\n# \n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nRTA_BUTTON_TEXT=Upravit UI\n#XTIT\nERROR_TITLE=\\u00DApravu u\\u017Eivatelsk\\u00E9ho rozhran\\u00ED nelze spustit\n\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=RTA-FLP-Plug-In\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Pou\\u017E\\u00EDv\\u00E1te nepodporovan\\u00FD prohl\\u00ED\\u017Ee\\u010D. Pou\\u017Eijte Chrome nebo Internet Explorer (verze 10 nebo vy\\u0161\\u0161\\u00ED).\n#XMSG: Technical error\nTECHNICAL_ERROR=Technick\\u00E1 chyba. Kontaktujte t\\u00FDm podpory.\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Prohl\\u00ED\\u017Ee\\u010D nen\\u00ED podporov\\u00E1n\n\n#XHED: Title of a dialog explaining that adaptation will be closed\nHEADER_FLEX_DISABLED=Informace\n\n#XMSG: Dialog message for flex not enabled\nMSG_FLEX_DISABLED=Tato aplikace nen\\u00ED aktivov\\u00E1na pro \\u00FApravy. V\\u00EDce informac\\u00ED viz [zde](https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
