	"sap/ushell/plugins/rta/i18n/i18n_tr.properties":'# Resource bundle for runtime authoring ushell plug-in\n# \n\n# Copyright (c) 2015 SAP SE, All Rights Reserved\n\n#XTIT\nRTA_BUTTON_TEXT=UI uyarla\n#XTIT\nERROR_TITLE=UI uyarlama ba\\u015Flat\\u0131lam\\u0131yor\n\n#XTIT: Application title of the FLP plugin in app descriptor\nAPP_TITLE=RTA FLP eklentisi\n\n#XMSG: Error Message when using unsupported Browser\nMSG_UNSUPPORTED_BROWSER=Desteklenmeyen taray\\u0131c\\u0131 kullan\\u0131yorsunuz. Google Chrome veya Microsoft Internet Explorer (versiyon 10 veya daha \\u00FCst\\u00FCn\\u00FC) kullan\\u0131n.\n#XMSG: Technical error\nTECHNICAL_ERROR=Teknik hata. Destek ekibiyle irtibata ge\\u00E7in.\n#XTIT: Title of the ErrorMessage Window\nTIT_UNSUPPORTED_BROWSER=Taray\\u0131c\\u0131 desteklenmiyor\n\n#XHED: Title of a dialog explaining that adaptation will be closed\nHEADER_FLEX_DISABLED=Bilgiler\n\n#XMSG: Dialog message for flex not enabled\nMSG_FLEX_DISABLED=Bu uygulama uyarlama i\\u00E7in etkinle\\u015Ftirilmedi. Daha fazla bilgi i\\u00E7in [buraya] bak\\u0131n. (https\\://help.sap.com/viewer/4fc8d03390c342da8a60f8ee387bca1a/latest/en-US/ef97b2485aa34a8890f4d51e5c2b15a8.html).\n',
